import React from "react";
import "./Courses.css";
const UploadCourses = () => {
  return (
    <div className="MainUploadCourseBlock">
      <div className="ChildUploadCourseBlock">
        <h2>Upload Your Courses Here!</h2>
      </div>
    </div>
  );
};

export default UploadCourses;
